import * as React from "react";
import { connect } from "react-redux";
import { Button } from 'react-bootstrap';
import { logIn } from "../actions/current";

interface IProps {
  logInConnect: () => void;
}

const LogIn = ({ logInConnect }: IProps) => (
  <>
    <div className="container">
      <div className="row align-items-center h-100">
        <div className="col-md-4 mx-auto">
          <div className="text-center bbox-title border" >
            <h4>Login.</h4>
            <small>Enter your login details.</small>
          </div>
          <div className="bbox-box border">
            <form >
              <div className="form-group">
                <label className="form-label" >Email address</label>
                <input type="email" name="email" id="email" className="form-control" />
              </div>
              <div className="form-group">
                <label className="form-label" >Password</label>
                <input type="password" name="password" id="password" className="form-control" />
              </div>
              <button type="submit" className="btn btn-success" onClick={logInConnect}  >Login</button>
              <Button variant="danger" type="button" href="/register" className="float-right" >
                Register
              </Button>
            </form>
          </div>
        </div>
      </div>
    </div>
  </>
);

const mapDispatchToProps = {
  logInConnect: logIn
};

export default connect(
  null,
  mapDispatchToProps,
)(LogIn);
